                                                <p style="margin:0"><span>While I focus on PVP games, I also try to play all the latest RPGs and FPS games. When I started taking video games more seriously, I dabbled in eSports competitions. You can still find me at a local competitions. Lately, I mostly spend my time sharing my PVP videos with the world, talking about tactics and the rules of the road to make gameplay better for all of us.</span></p></div>
