                                                <p style="margin:0"><span>I can't remember when I didn't play video games. I still revisit some of the classic games for speed runs and a nostalgia kick. On the rare days when I'm not streaming, I like to get out to the rock climbing gym and try new pizza places with friends.</span></p></div>
